}

export const NavBar = () => {

    const links = ['lala', "toto", "test"]

    return (
        <div className='h-[64px] sticky top-0 z-20 w-full border-b bg-white'>
            <div className='px-12'>
                <div className='p-4 flex items-center'>
                    <h1 className="font-semibold text-gray-800">HEADER</h1>
                </div>
                <div>
                    {
                        links.map((link, key) => {
                            return <p>{link}</p>
                        })
                    }
                </div>
            </div>
        </div>
    )
}
